  `has_dividended` int(11) DEFAULT '0' COMMENT '0：未派息，1：已派息 2：已计算（未实际发放）',
  `add_interest` double(12,2) DEFAULT '0.00' COMMENT '加息金额',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `interest_ibfk_1` (`investment_id`) USING BTREE,
  KEY `user_id_index` (`user_id`) USING BTREE,
  KEY `date` (`date`) USING BTREE,
  KEY `interest_amount` (`interest_amount`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=36 DEFAULT CHARSET=utf8 COMMENT='利息表';

-- ----------------------------
-- Records of interest
