-- ----------------------------
-- Table structure for investment
-- ----------------------------
DROP TABLE IF EXISTS `investment`;
CREATE TABLE `investment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_no` varchar(50) DEFAULT NULL COMMENT '订单号',
  `type` int(11) DEFAULT '1' COMMENT '类型：1定期',
  `product_id` int(11) DEFAULT NULL COMMENT 'product.id',
  `user_id` int(11) DEFAULT NULL COMMENT 'user.id',
  `project_id` int(11) DEFAULT NULL COMMENT 'project.id',
  `amount` double(12,2) DEFAULT NULL COMMENT '投资金额',
  `interest_amount` double(12,2) DEFAULT NULL COMMENT '总利息',
  `balance_pay_money` decimal(12,2) DEFAULT NULL COMMENT '余额支付金额',
  `rate_coupon_id` int(11) DEFAULT NULL COMMENT 'rate_coupon.id',
  `hongbao_id` int(11) DEFAULT NULL COMMENT 'hongbao.id',
  `hongbao_money` decimal(12,2) DEFAULT NULL COMMENT '红包金额',
  `remain_amount` decimal(12,2) DEFAULT NULL COMMENT '需支付金额',
  `client` varchar(10) DEFAULT NULL COMMENT '终端：ClientEnum',
  `pay_status` int(11) DEFAULT '0' COMMENT '支付状态 0：未支付，1：已支付',
  `order_status` int(11) DEFAULT '0' COMMENT '0：未饲养，1：饲养期，2：已卖牛 3 已取消',
