  UNIQUE KEY `user_id2` (`order_no`,`user_id`),
  KEY `user_id` (`user_id`) USING BTREE,
  KEY `project_id` (`project_id`) USING BTREE,
  KEY `time` (`create_date`) USING BTREE,
  KEY `IDX_HONGBAO_ID_PROJECT_ID` (`hongbao_id`,`project_id`) USING BTREE,
  CONSTRAINT `investment_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `investment_ibfk_2` FOREIGN KEY (`project_id`) REFERENCES `project` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=98 DEFAULT CHARSET=utf8 COMMENT='用户投资表';

