-- ----------------------------
-- Table structure for lottery_count
-- ----------------------------
DROP TABLE IF EXISTS `lottery_count`;
CREATE TABLE `lottery_count` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '抽奖记录ID',
  `user_id` int(11) DEFAULT NULL COMMENT 'user.id',
  `phone` varchar(64) DEFAULT NULL COMMENT '抽奖人电话',
  `sys_count` int(4) unsigned zerofill DEFAULT NULL COMMENT '每日系统赠送抽奖次数',
