  `ex_count` int(4) unsigned zerofill DEFAULT NULL COMMENT '实际抽奖次数',
  `time` datetime DEFAULT NULL COMMENT '在投计算记录时间',
  `amount` double(11,2) DEFAULT NULL COMMENT '用户实际在投记录',
  `temp` int(11) DEFAULT NULL COMMENT '记录最高获赠奖励次数',
  `version` int(11) DEFAULT '0' COMMENT '乐观锁',
  `activity_id` int(11) DEFAULT NULL COMMENT '活动id',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_id` (`user_id`,`activity_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户抽奖次数';

