-- ----------------------------
-- Table structure for lottery_gift
-- ----------------------------
DROP TABLE IF EXISTS `lottery_gift`;
CREATE TABLE `lottery_gift` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `name` varchar(255) DEFAULT NULL COMMENT '奖品名称',
  `type` int(4) DEFAULT NULL COMMENT '奖品类型1加息券，体验金2实物奖品',
  `descript` varchar(255) DEFAULT NULL COMMENT '奖品描述',
