  `num` int(11) DEFAULT NULL COMMENT '奖品数量',
  `amount` double(12,2) DEFAULT NULL COMMENT '奖品价值',
  `left_num` int(11) DEFAULT NULL COMMENT '剩余数量',
  `rate` double(10,8) DEFAULT NULL COMMENT '奖品抽中概率',
  `rule` varchar(300) DEFAULT NULL COMMENT '使用规则, 用于发放, 不同的奖品有不同的发放规则',
  `prize_type` varchar(30) DEFAULT NULL COMMENT '奖品类型, LotteryGiftPrizeTypeEnum',
  `activity_id` int(11) DEFAULT '0' COMMENT '活动id   分组奖品',
  `version` int(11) DEFAULT '0' COMMENT '乐观锁',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=186 DEFAULT CHARSET=utf8 COMMENT='抽奖活动奖品表';

