CREATE TABLE `lottery_record` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(11) DEFAULT NULL COMMENT 'user.id',
  `phone` varchar(64) DEFAULT NULL COMMENT '抽奖人电话',
  `gift_id` int(11) DEFAULT NULL COMMENT '奖品ID',
  `gift_name` varchar(50) DEFAULT NULL COMMENT '奖品名称',
  `count_type` int(4) DEFAULT NULL COMMENT '使用的哪种次数类型  0系统赠送，1投资赠送',
  `user_address_id` int(11) DEFAULT NULL COMMENT '寄件地址ID',
  `create_date` datetime DEFAULT NULL COMMENT '抽奖时间',
  `ip` varchar(255) DEFAULT NULL,
  `track_type` int(4) DEFAULT NULL COMMENT '快递类型',
  `track_no` varchar(255) DEFAULT NULL COMMENT '快递单号',
  `status` int(11) DEFAULT NULL COMMENT '0未中奖1未发放奖品2已发放3用户收货',
  `activity_id` int(11) DEFAULT '0' COMMENT '新增活动id区分活动不同交易类型不同',
  `version` int(11) DEFAULT '0' COMMENT '乐观锁',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注，用户留言',
