  `type` int(11) DEFAULT NULL COMMENT '0充值1提现',
  `weight` int(11) DEFAULT NULL COMMENT '权重0-100，选择通道时优先选择权重更高的',
  `status` int(11) DEFAULT '0' COMMENT '0激活1屏蔽',
