  `name` varchar(16) DEFAULT NULL COMMENT '物权名称',
  `dividend_method` int(11) DEFAULT NULL COMMENT '派息方式',
  `min_amount` double(12,2) DEFAULT NULL COMMENT '起投金额',
  `max_amount` double(12,2) DEFAULT NULL COMMENT '最大限额',
  `increase_amount` double(12,2) DEFAULT NULL COMMENT '递增金额 比如 100起投 100递增',
  `support_hongbao` tinyint(11) DEFAULT '0' COMMENT '是否支持红包0支持1不支持',
  `support_rate_coupon` tinyint(4) DEFAULT NULL COMMENT '是否支持加息券0支持1不支持',
  `out_days` int(11) DEFAULT NULL COMMENT '退出时间比如 30天可退出',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL,
  `status` int(11) DEFAULT '0' COMMENT '0未启用1启用2已删除',
  `version` int(11) DEFAULT '0' COMMENT '乐观锁',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='牧场产品表';

