-- ----------------------------
-- Table structure for project
-- ----------------------------
DROP TABLE IF EXISTS `project`;
CREATE TABLE `project` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `parent_id` int(11) DEFAULT NULL COMMENT '父projectID，债券用',
  `product_id` int(11) DEFAULT NULL,
  `investment_id` int(11) DEFAULT NULL COMMENT 'investment.id',
  `enterprise_id` int(11) DEFAULT NULL COMMENT '融资企业ID',
  `title` varchar(1024) DEFAULT NULL COMMENT '项目名称',
  `annualized` float(4,4) DEFAULT '0.0000' COMMENT '年化利率',
  `increase_annualized` float(5,5) DEFAULT '0.00000' COMMENT '加息',
  `deadline` datetime DEFAULT NULL COMMENT '融资的截至时间',
  `limit_days` int(11) DEFAULT '0' COMMENT '投资期限/天',
  `total_amount` double(11,2) DEFAULT '0.00' COMMENT '总融资金额',
  `start_time` datetime DEFAULT NULL COMMENT '项目开始投资时间',
  `create_date` datetime DEFAULT CURRENT_TIMESTAMP,
  `update_date` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `repayment_method` int(11) DEFAULT '0' COMMENT '还款方式0每月还息，到期还本 1每月息本都还',
  `project_description` varchar(1024) DEFAULT NULL COMMENT '项目描述',
  `project_type` int(11) DEFAULT '0' COMMENT '项目类型0定期',
  `user_id` int(11) DEFAULT NULL COMMENT '创建者ID为空是系统创建不为空则是债券类用户创建',
  `investors_num` int(11) DEFAULT '0' COMMENT '投资笔数',
  `invested_amount` double(12,2) DEFAULT '0.00' COMMENT '已投资金额',
  `status` int(11) DEFAULT '0' COMMENT '0建档1已发布2已成交3已售出4已回购',
  `version` int(11) DEFAULT '0' COMMENT '乐观锁',
  `tag` varchar(255) DEFAULT NULL COMMENT '标签',
  `item_number` varchar(255) DEFAULT NULL COMMENT '项目编号',
  `noob` int(11) DEFAULT '0' COMMENT '0正常1新手标',
  `rate_coupon_days` int(6) DEFAULT '0' COMMENT '加息券使用限制天数',
  `sort` int(5) DEFAULT '99' COMMENT '排序字段, 默认99',
  `contract_id` varchar(255) DEFAULT NULL COMMENT '合同ID',
  `transferable` int(11) DEFAULT NULL COMMENT '持有多少天后可转让, 设置0为不可转让',
  `plat_service_charge` double(12,6) DEFAULT '0.002500' COMMENT '平台服务费率(安居贷), 必填',
  `channel_service_charge` double(12,6) DEFAULT '0.000100' COMMENT '渠道服务费率(安居贷)',
  `repay_unit` varchar(20) DEFAULT 'day' COMMENT '还款周期单位月: month, 日:day',
  `raise_fee` double(12,2) DEFAULT '0.00' COMMENT '饲养费',
  `manage_fee` double(12,2) DEFAULT '0.00' COMMENT '管理费',
  `ear_number` varchar(50) DEFAULT NULL COMMENT '耳标号',
  `safe_number` varchar(50) DEFAULT NULL COMMENT '保险编号',
  `interest_amount` double(12,2) DEFAULT NULL COMMENT '总利息',
  PRIMARY KEY (`id`),
  KEY `create_user` (`user_id`) USING BTREE,
  KEY `project_type` (`project_type`) USING BTREE,
  KEY `enterprise_id` (`enterprise_id`) USING BTREE,
  KEY `repayment_method_id` (`repayment_method`) USING BTREE,
  KEY `create_time` (`create_date`) USING BTREE,
  KEY `parent_id` (`parent_id`) USING BTREE,
  KEY `investment_id` (`investment_id`) USING BTREE,
  KEY `status` (`status`) USING BTREE,
  CONSTRAINT `project_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `project_ibfk_2` FOREIGN KEY (`enterprise_id`) REFERENCES `enterprise` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=36 DEFAULT CHARSET=utf8 COMMENT='项目表';

-- ----------------------------
-- Records of project
-- ----------------------------

-- ----------------------------
-- Table structure for project_class
-- ----------------------------
DROP TABLE IF EXISTS `project_class`;
CREATE TABLE `project_class` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(100) DEFAULT NULL COMMENT '项目组名称',
  `noob` int(11) DEFAULT '0' COMMENT '0非新手标1新手标',
  `annualized` float(4,4) DEFAULT '0.0000',
  `increase_annualized` float(5,5) DEFAULT '0.00000' COMMENT '加息',
  `limit_days` int(11) DEFAULT '0' COMMENT '投资期限/天',
  `tag` varchar(255) DEFAULT NULL COMMENT '标签',
  `sort` int(5) NOT NULL DEFAULT '0' COMMENT '排序',
  `status` int(10) DEFAULT NULL COMMENT '默认1有效 0无效',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='项目分类表';

-- ----------------------------
-- Records of project_class
