CREATE TABLE `project_picture` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `project_id` int(11) DEFAULT NULL,
  `type` int(11) DEFAULT NULL COMMENT '0项目本身图片1担保机构图片',
  `name` varchar(64) DEFAULT NULL,
  `upload_id` int(11) DEFAULT NULL,
