  CONSTRAINT `project_picture_ibfk_2` FOREIGN KEY (`upload_id`) REFERENCES `upload` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=59 DEFAULT CHARSET=utf8 COMMENT='担保机构涉及到的企业相关担保图片\r\n';

-- ----------------------------
-- Records of project_picture
-- ----------------------------

-- ----------------------------
-- Table structure for project_property_value
-- ----------------------------
DROP TABLE IF EXISTS `project_property_value`;
CREATE TABLE `project_property_value` (
  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
