-- ----------------------------
-- Table structure for rate_coupon
-- ----------------------------
DROP TABLE IF EXISTS `rate_coupon`;
CREATE TABLE `rate_coupon` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `type` int(11) DEFAULT '0' COMMENT '0日加息券1月加息券2新活期加息券3定期加息券',
  `source` int(11) DEFAULT '0' COMMENT '来源0签到1全民理财师2活动赠送3抗战活动派送4分享二维码送5首次投资赠送6邀请好友赠送7 11月福利赠送 71 12月福利赠送11首次绑卡赠送 13两周年赠送  999系统赠送\r\n\r\n',
  `title` varchar(250) DEFAULT NULL,
  `descript` varchar(255) DEFAULT NULL COMMENT '来源描述',
  `rate` double(12,5) DEFAULT NULL COMMENT '加息券利率',
  `create_time` datetime DEFAULT NULL,
  `use_time` datetime DEFAULT NULL,
  `expire_time` date DEFAULT NULL,
  `days` int(11) DEFAULT NULL COMMENT '加息的天数',
  `begin_time` date DEFAULT NULL COMMENT '收益开始时间',
  `end_time` date DEFAULT NULL COMMENT '收益结束时间',
  `income` double(12,2) DEFAULT NULL COMMENT '预估收益',
  `investment_id` int(11) DEFAULT NULL COMMENT '投资ID',
  `status` int(11) DEFAULT '1' COMMENT '0使用中1未使用2已使用3已失效',
  `has_dividended` int(11) DEFAULT '0' COMMENT '0未派息1已派息',
  `use_rule` varchar(200) DEFAULT NULL COMMENT '加息券使用规则，JSON({"projectValidMinAmount":100,"projectValidMinDay":30}100起投30天以上标可用)',
  `rate_coupon_type` varchar(20) DEFAULT 'unlimited' COMMENT 'unlimited: 无限制加息券, limited: 有限制加息券',
  `admin_id` int(11) DEFAULT NULL COMMENT '发放加息券后台用户id',
  `coupon_id` varchar(255) DEFAULT NULL COMMENT '优惠券id',
  `repay_unit` varchar(20) DEFAULT NULL COMMENT 'limit_days的单位, 月: month, 日:day',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`) USING BTREE,
  KEY `create_time` (`create_time`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='加息券';

-- ----------------------------
-- Records of rate_coupon
-- ----------------------------

-- ----------------------------
-- Table structure for rate_coupon_audit
-- ----------------------------
DROP TABLE IF EXISTS `rate_coupon_audit`;
CREATE TABLE `rate_coupon_audit` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `investment_id` int(11) DEFAULT NULL COMMENT '当前使用投资ID',
  `coupon_id` int(11) DEFAULT NULL,
  `apply_customer_id` int(11) DEFAULT NULL COMMENT '申请加息客服ID',
  `apply_customer_name` varchar(255) DEFAULT NULL,
  `apply_time` datetime DEFAULT NULL,
  `audit_id` int(11) DEFAULT NULL COMMENT '审核管理员ID',
  `audit_name` varchar(255) DEFAULT NULL,
  `audit_over_time` datetime DEFAULT NULL COMMENT '审核结束时间',
  `apply_customer_remark` varchar(255) DEFAULT NULL COMMENT '申请审核备注信息',
  `audit_remark` varchar(255) DEFAULT NULL COMMENT '审核员备注信息',
  `status` int(11) DEFAULT '0' COMMENT '0审核中1审核通过2审核拒绝',
  PRIMARY KEY (`id`),
  UNIQUE KEY `investment_id` (`investment_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='加息券审核表';

