  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '活动收益显示名称',
  `user_id` int(11) DEFAULT NULL COMMENT 'user.id',
  `other_id` int(11) DEFAULT NULL COMMENT '业务ID',
  `table_name` varchar(255) DEFAULT NULL COMMENT '业务表',
  `aoe_type` varchar(50) DEFAULT NULL COMMENT '操作类型：AccountOperateEnum',
  `amount` double(12,2) DEFAULT NULL COMMENT '操作金额',
  `balance_amount` double(12,2) DEFAULT NULL COMMENT '当前账户余额',
  `frozen_amount` double(12,2) DEFAULT NULL COMMENT '当前账户冻结余额',
  `credit_amount` double(12,2) DEFAULT NULL COMMENT '操作后授信资金',
  `frozen_credit_amount` double(12,2) DEFAULT NULL COMMENT '操作后冻结的授信资金',
  `reamk` varchar(200) DEFAULT NULL COMMENT '备注',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `type` (`aoe_type`) USING BTREE,
  KEY `IDX_USER_ID` (`user_id`) USING BTREE,
  KEY `IDX_OTHER_ID_TABLE_NAME` (`other_id`,`table_name`) USING BTREE,
  KEY `IDX_TABLE_NAME` (`table_name`) USING BTREE,
  KEY `IDX_US_SO_TY` (`user_id`,`aoe_type`) USING BTREE,
  KEY `IDX_SO_TY_TI` (`aoe_type`) USING BTREE,
  KEY `IDX_TYPE_AMOUNT` (`aoe_type`,`amount`) USING BTREE,
  KEY `IDX_USER_ID_TYPE` (`user_id`,`aoe_type`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=161 DEFAULT CHARSET=utf8 COMMENT='交易日志';

-- ----------------------------
-- Records of trade_record
