-- ----------------------------
-- Table structure for ts_trade_message_log
-- ----------------------------
DROP TABLE IF EXISTS `ts_trade_message_log`;
CREATE TABLE `ts_trade_message_log` (
  `idx` bigint(20) NOT NULL AUTO_INCREMENT,
  `id` varchar(50) DEFAULT NULL,
  `message_url` varchar(100) DEFAULT NULL COMMENT '报文发送地址',
  `message_channel` varchar(50) DEFAULT NULL COMMENT '报文发送类型，枚举（富友，新浪）',
  `message_operate` varchar(50) DEFAULT NULL COMMENT '报文操作，枚举，（充值，提现）',
  `message_type` varchar(50) DEFAULT NULL COMMENT '报文类型，枚举，（send,back）',
