  `in_order_id` varchar(50) DEFAULT NULL COMMENT '内部订单号',
  `out_order_id` varchar(50) DEFAULT NULL COMMENT '外部订单号',
  `message_info_ciphertext` varchar(300) DEFAULT NULL COMMENT '报文内容 (加密后)',
  `message_info` varchar(1000) DEFAULT NULL COMMENT '内容',
  `message_status` varchar(50) DEFAULT NULL COMMENT '报文状态',
  `status` varchar(50) DEFAULT NULL COMMENT '状态根据需要确认使用',
