-- ----------------------------
-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(64) NOT NULL COMMENT '用户名',
  `password` varchar(64) DEFAULT NULL COMMENT '密码',
  `email` varchar(128) DEFAULT NULL COMMENT '邮箱',
  `phone` varchar(32) DEFAULT NULL COMMENT '手机号',
  `avatar_id` int(11) DEFAULT NULL COMMENT '头像ID',
  `true_name` varchar(32) DEFAULT NULL COMMENT '真实姓名',
  `identity_card` varchar(32) DEFAULT NULL COMMENT '身份证',
  `card_front` int(11) DEFAULT NULL COMMENT '身份证正面照片',
  `card_back` int(11) DEFAULT NULL COMMENT '身份证背面照片',
  `pay_password` varchar(64) DEFAULT NULL COMMENT '支付密码',
  `sex` int(11) DEFAULT '1' COMMENT '0女1男2保密',
  `birthday` datetime DEFAULT NULL COMMENT '生日',
  `education` int(11) DEFAULT NULL COMMENT '0高中或以下1大专2本科3研究生或以上',
  `school` varchar(64) DEFAULT NULL COMMENT '毕业院校',
  `marriage` int(11) DEFAULT NULL COMMENT '0未婚1已婚2其他',
  `register_ip` varchar(64) DEFAULT NULL COMMENT '注册IP',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `last_login_time` datetime DEFAULT NULL COMMENT '最后登陆时间',
  `last_login_ip` varchar(64) DEFAULT NULL COMMENT '最后登陆IP',
  `error_count` int(11) DEFAULT '0' COMMENT '密码错误次数',
  `invite_code` varchar(32) DEFAULT NULL COMMENT '推荐码',
  `invite_by_code` varchar(32) DEFAULT NULL COMMENT '推荐人',
  `token` varchar(128) DEFAULT NULL COMMENT 'token',
  `app_version` varchar(20) DEFAULT NULL COMMENT 'app版本',
  `level` int(11) DEFAULT '0' COMMENT '用户等级0普通用户1VIP用户',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '0可用1不可用2已删除',
  `sign_time` datetime DEFAULT NULL COMMENT '签到时间',
  `activity_sign_combo_count` int(4) DEFAULT NULL COMMENT '活动连续签到次数',
  `normal_sign_combo_count` int(10) DEFAULT NULL COMMENT '普通连续签到次数',
  `is_gesture_password` int(11) DEFAULT '0' COMMENT '是否启用手势密码    0：未启用     1：启用',
  `gesture_password` varchar(255) DEFAULT NULL COMMENT '手势密码',
  `is_fingerprint_password` int(11) DEFAULT '0' COMMENT '是否启用指纹密码  0：未启用     1：启用',
  `client` varchar(10) DEFAULT NULL COMMENT '终端：ClientEnum',
  `data_source` varchar(10) DEFAULT '0' COMMENT '数据来源  0：平台，1：亿亿理财',
  `channel_id` varchar(50) DEFAULT NULL COMMENT '渠道ID',
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`) USING BTREE,
  UNIQUE KEY `phone` (`phone`) USING BTREE,
  UNIQUE KEY `email` (`email`) USING BTREE,
  UNIQUE KEY `indetity_card` (`identity_card`) USING BTREE,
  KEY `user_ibfk_1` (`avatar_id`) USING BTREE,
  KEY `invite_code` (`invite_code`) USING BTREE,
  KEY `invite_by_code` (`invite_by_code`) USING BTREE,
  KEY `IDX_TOKEN` (`token`) USING BTREE,
  KEY `true_name` (`true_name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of user
-- ----------------------------

