  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '省市',
  `reserve` int(11) DEFAULT '0' COMMENT '是否默认地址 0否1是 2删除',
