-- ----------------------------
-- Table structure for user_signed
-- ----------------------------
DROP TABLE IF EXISTS `user_signed`;
CREATE TABLE `user_signed` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `time` datetime DEFAULT NULL COMMENT '签到时间',
  `client` varchar(20) DEFAULT NULL COMMENT '终端：ClientEnum',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='用户签到表';

-- ----------------------------
-- Records of user_signed
-- ----------------------------

-- ----------------------------
-- Table structure for user_sign_award
-- ----------------------------
DROP TABLE IF EXISTS `user_sign_award`;
CREATE TABLE `user_sign_award` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `is_invested` int(2) DEFAULT NULL COMMENT '默认1已投资用户配置, 0为投资用户配置',
  `user_id` int(11) DEFAULT NULL COMMENT '用户id',
  `prize_type` varchar(1500) DEFAULT NULL COMMENT '奖励类型: expMoney, rateCoupon, investHongBao, cashHongBao',
  `count` int(3) DEFAULT NULL COMMENT '数量',
  `amount` double(12,2) DEFAULT NULL COMMENT '奖品价值',
  `rule` varchar(300) DEFAULT NULL COMMENT '使用规则, 用于发放, 不同的奖品有不同的发放规则',
  `is_deleted` int(10) DEFAULT '1' COMMENT '默认1有效 0无效',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '变更时间',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户签到奖励表';

-- ----------------------------
-- Records of user_sign_award
-- ----------------------------

-- ----------------------------
-- Table structure for user_sign_config
-- ----------------------------
DROP TABLE IF EXISTS `user_sign_config`;
CREATE TABLE `user_sign_config` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `start_time` datetime DEFAULT NULL COMMENT '活动开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '活动结束时间',
  `is_invested` int(2) DEFAULT NULL COMMENT '默认1已投资用户配置, 0为投资用户配置',
  `normal_prize` varchar(1500) DEFAULT NULL COMMENT '普通签到奖品配置(jsonArray): [{"giftId":"gift表id", "count": 1}]',
  `activity_prize` varchar(1500) DEFAULT NULL COMMENT '活动签到奖品配置(jsonArray): [{"giftId":"gift表id", "count": 1}]',
  `combo_prize` varchar(1500) DEFAULT NULL COMMENT '活动连续签到奖品配置(json): {"times4":{"giftId":"80", "count":1}, "times8":{"giftId":"80", "count":1}}',
  `is_deleted` int(10) DEFAULT '1' COMMENT '默认1有效 0无效',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '变更时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户签到配置表';

-- ----------------------------
-- Records of user_sign_config
-- ----------------------------

-- ----------------------------
-- Table structure for withdraw
-- ----------------------------
DROP TABLE IF EXISTS `withdraw`;
CREATE TABLE `withdraw` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `type` int(11) DEFAULT '0' COMMENT '提现类型0T+0 1t+1',
  `order_no` varchar(255) DEFAULT NULL COMMENT '订单号',
  `amount` double(12,2) DEFAULT NULL,
  `real_amount` double(12,2) DEFAULT '0.00' COMMENT '实际到账金额',
  `card_no` varchar(255) DEFAULT NULL COMMENT '要提现的卡号',
  `pay_channel` varchar(20) DEFAULT NULL COMMENT '支付渠道：OutPayEnum',
  `client` varchar(20) DEFAULT NULL COMMENT '终端：ClientEnum',
  `bank_id` int(11) DEFAULT NULL COMMENT '所属银行ID',
  `create_date` datetime DEFAULT NULL COMMENT '提现申请时间',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `tech_operate_user_id` int(11) DEFAULT NULL COMMENT '操作员',
  `tech_operate_time` datetime DEFAULT NULL COMMENT '操作时间',
  `tech_remark` varchar(255) DEFAULT NULL,
  `finance_operate_user_id` int(11) DEFAULT NULL,
  `finance_operate_time` datetime DEFAULT NULL,
  `finance_remark` varchar(255) DEFAULT NULL,
  `status` int(11) DEFAULT '0' COMMENT '0审核中1提现成功2提现失败3取消4银行处理中5挂起(状态未知）',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_id_2` (`user_id`,`order_no`) USING BTREE,
  KEY `user_id` (`user_id`) USING BTREE,
  KEY `IDX_USER_ID_BANK_ID` (`user_id`,`bank_id`) USING BTREE,
  CONSTRAINT `withdraw_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='提现表';

-- ----------------------------
-- Records of withdraw
-- ----------------------------

-- ----------------------------
-- Table structure for withdraw_black
-- ----------------------------
DROP TABLE IF EXISTS `withdraw_black`;
CREATE TABLE `withdraw_black` (
  `user_id` int(11) NOT NULL,
  `lock_time` datetime DEFAULT NULL,
  `reason` varchar(255) DEFAULT NULL COMMENT '锁定原因简单描述',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `user_id` (`user_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='恶意提现黑名单表';

-- ----------------------------
-- Records of withdraw_black
-- ----------------------------

-- ----------------------------
-- Table structure for withdraw_coupon
-- ----------------------------
DROP TABLE IF EXISTS `withdraw_coupon`;
CREATE TABLE `withdraw_coupon` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL COMMENT 'user.id',
  `withdraw_id` int(11) DEFAULT NULL COMMENT 'withdraw.id',
  `title` varchar(32) DEFAULT NULL COMMENT '标题',
  `descript` varchar(255) DEFAULT NULL,
  `source` int(11) DEFAULT '0' COMMENT '来源0摇一摇1活动',
  `activity_id` int(11) DEFAULT NULL COMMENT '如果是活动获得。保存活动ID',
  `create_date` datetime DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `use_time` datetime DEFAULT NULL COMMENT '使用时间',
  `expire_time` date DEFAULT NULL COMMENT '过期时间',
  `status` int(11) DEFAULT '0' COMMENT '（单独状态标记当前提现券是否可用）0可用1不可用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='提现券';

-- ----------------------------
-- Records of withdraw_coupon
-- ----------------------------

-- ----------------------------
-- Table structure for withdraw_temp
-- ----------------------------
DROP TABLE IF EXISTS `withdraw_temp`;
CREATE TABLE `withdraw_temp` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_no` varchar(255) NOT NULL COMMENT '订单编号',
  `bank_code` varchar(50) DEFAULT NULL COMMENT '银行code',
  `card_no` varchar(50) DEFAULT NULL COMMENT '银行卡号',
  `true_name` varchar(50) DEFAULT NULL COMMENT '真实姓名',
  `amount` double(12,2) DEFAULT '0.00' COMMENT '金额',
  `status` varchar(150) DEFAULT NULL COMMENT '状态:0未执行 1已完成 2失败',
  `type` int(11) DEFAULT NULL COMMENT '提现类型0T+0 1t+1',
  `pay_channel` varchar(20) DEFAULT NULL COMMENT '支付渠道：OutPayEnum',
  `client` varchar(20) DEFAULT NULL COMMENT '终端：ClientEnum',
  `predict_send_date` datetime DEFAULT NULL COMMENT '预计发送时间',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '变更时间',
  `user_id` int(11) DEFAULT NULL COMMENT '用户Id',
  `real_amount` double(12,2) DEFAULT NULL COMMENT '真实金额',
  PRIMARY KEY (`id`),
  UNIQUE KEY `order_no` (`order_no`) USING BTREE,
  KEY `predict_send_date_k` (`predict_send_date`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='提现临时表';

-- ----------------------------
-- Records of withdraw_temp
-- ----------------------------

-- ----------------------------
-- Table structure for yao_count
-- ----------------------------
DROP TABLE IF EXISTS `yao_count`;
CREATE TABLE `yao_count` (
  `user_id` int(11) NOT NULL COMMENT 'user.id',
  `count` int(11) DEFAULT NULL COMMENT '次数',
  `today_count` tinyint(1) DEFAULT NULL COMMENT '当天次数',
  `time` date DEFAULT NULL COMMENT '时间',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='摇一摇次数';

-- ----------------------------
-- Records of yao_count
-- ----------------------------

-- ----------------------------
-- Table structure for yao_record
-- ----------------------------
DROP TABLE IF EXISTS `yao_record`;
CREATE TABLE `yao_record` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL COMMENT 'user.id',
  `client` varchar(20) DEFAULT NULL COMMENT '终端：ClientEnum',
  `type` int(11) DEFAULT NULL COMMENT '0没抽中1现金红包2加息券3投资红包4提现券',
  `other_id` int(11) DEFAULT NULL,
  `words` varchar(32) DEFAULT NULL COMMENT '没摇中时的随机词',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `user_id_index` (`user_id`) USING BTREE,
  KEY `time_index` (`create_date`) USING BTREE,
  KEY `type` (`type`) USING BTREE,
  KEY `other_id` (`other_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='摇一摇记录';

-- ----------------------------
-- Records of yao_record
-- ----------------------------
