INSERT INTO `project` VALUES ('25', null, '1', null, '1', '0520', '0.1700', '0.10000', null, '30', '100000.00', null, '2019-05-20 14:53:35', '2019-05-20 17:50:45', '0', '黑色无角肉用牛。多年来称为亚伯丁安格斯牛(Aberdeen Angus)，起源于苏格兰东北部，与有时称为英国最老品种的卷毛加罗韦牛(curly-coated Galloway)亲缘关系密切。19世纪初很多育种家包括著名的华特生(Hugh Watson)等改良了这个品种，固定了该品种现在的体型。外貌特征是黑色无角，体躯矮而结实，肉质好，出肉率高。纯种或杂交的安格斯阉牛在英美主要肉畜展览会中保持很高声誉。从2000年山东省引进该品种。20世纪末常用於远交和杂交。婆安格斯牛(Brangus)是婆罗门牛(Brahman)和安格斯牛育成的一个支种，以抗热闻名。', '0', null, '0', '0.00', '0', '0', '新手', null, '0', '0', '99', null, null, '0.002500', '0.000100', 'day', '30.00', '60.00', '465789123', '321654987', '1362.00');
